		res = (cost_price_standard + sales_price_standard * (quote_agent_fee / 100 + 0.03)) * quote_currency_factor;
	}
    else {
        if (services == 1) //comm;
            res = (price_user + price_user * (1 / (1 - margin_comm / 100)) * (quote_agent_fee / 100 + 0.03)) * quote_currency_factor;
        else if (services == 2) //inst;
            res = (price_user + price_user * (1 / (1 - margin_inst / 100)) * (quote_agent_fee / 100 + 0.03)) * quote_currency_factor;
        else if (services == 3) //ship;
            res = (price_user) * quote_currency_factor;
        else if (services == 4) //automation;
            res = (price_user) * quote_currency_factor;
        else res = (cost_price_standard + price_user * (quote_agent_fee / 100 + 0.03)) * quote_currency_factor;
    }
} else {
    if (price_user_set == 0) res = (cost_price_user_def + sales_price_standard * (quote_agent_fee / 100 + 0.03)) * quote_currency_factor;
    else res = (cost_price_user_def + price_user * (quote_agent_fee / 100 + 0.03)) * quote_currency_factor;
}

if (price_user_set == 0){ var sales_price_standard=sales_price_basic*(1+negot_margin/100)*(1-discount/100);
res = sales_price_standard*quote_currency_factor;
} else{ if(services == 1)//comm;
res = price_user*(1/(1-margin_comm/100))*quote_currency_factor;
else if(services == 2)//inst;
res = price_user*(1/(1-margin_inst/100))*quote_currency_factor;
else if(services == 3)//shipping;
res = price_user*quote_currency_factor;
else res = price_user*quote_currency_factor;
}

var sales_price_standard=sales_price_basic*(1+negot_margin/100)*(1-discount/100);
var cost_price_standard;
if (add_cost_add == "TRUE") cost_price_standard= (cost_price_EU+add_cost_cost)*(1-cost_base_discount/100);
else cost_price_standard=cost_price_EU*(1-cost_base_discount/100);
if(user_def == 0){ if (price_user_set == 0) res = (cost_price_standard+sales_price_standard*(quote_agent_fee/100+0.03))*quote_currency_factor;
else{ if(services == 1)//comm;
res = (price_user+price_user*(1/(1-margin_comm/100))*(quote_agent_fee/100+0.03))*quote_currency_factor;
else if(services == 2)//inst;
res = (price_user+price_user*(1/(1-margin_inst/100))*(quote_agent_fee/100+0.03))*quote_currency_factor;
else if(services == 3)//ship;
res = (price_user)*quote_currency_factor;
else res = (cost_price_standard+price_user*(quote_agent_fee/100+0.03))*quote_currency_factor;
} } else{ if (price_user_set == 0) res = (cost_price_user_def+sales_price_standard*(quote_agent_fee/100+0.03))*quote_currency_factor;
else res = (cost_price_user_def+price_user*(quote_agent_fee/100+0.03))*quote_currency_factor;
}
